import axios from 'axios';
import './App.css';





function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

        <button onClick = {axiosgetuser}>click me </button>
        <span></span>

      </header>
    </div>
  );
}

function axiosgetuser(){
  axios.post('/login',{"un":"@muki119","pass":"kim11","remember_me":true}).then(function(response){
    console.log(response.data.user)
  });

}

export default App;
